// SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";

contract Fanout {
  // mapping from user address to whether they have claimed their share
  mapping(address => bool) public claimed;

  // total number of shares available
  uint256 public totalShares;

  // address of the ERC20 token contract
  ERC20Burnable public token;


  // address of the contract that will burn the ERC20 tokens
  address public burner;

  // amount of ether in the contract
  uint256 public balance;

  // amount of ether in the contract
  uint256 public tokBalance;
  uint256 public tokBalanceo;

  // event that is emitted when a user claims their share
  event Claimed(address user, uint256 tokenShares, uint256 etherShares);

  constructor(address _tokenAddress, address _burnerAddress, uint256 _totalShares, uint256 _tokBalance)  {
    // set the initial number of shares to 10
    totalShares = _totalShares;
 // set the initial number of shares to 10
    tokBalance = _tokBalance;

    tokBalanceo = _tokBalance;
    // set the address of the contract that will burn the ERC20 tokens
    burner = _burnerAddress;
    // set the address of the ERC20 token contract
    token = ERC20Burnable(_tokenAddress);
  }

  // function to claim a share of the ERC20 tokens and ether
  function claim() public {
    // check if the caller has already claimed their share
    require(!claimed[msg.sender], "You have already claimed your share!");

    // calculate the number of token shares the caller is entitled to
    uint256 tokenShares = tokBalanceo / totalShares; // wat; I mean sure, but no

    // calculate the number of ether shares the caller is entitled to
    uint256 etherShares = balance / totalShares;

    // transfer the token shares to the caller
    token.transferFrom(burner, msg.sender, tokenShares);
payable(msg.sender).call{value:etherShares, gas: 24138};
    // transfer the ether shares to the caller
    payable(msg.sender).transfer(etherShares);

    // decrease the total number of shares by 1
    totalShares -= 1;

    // decrease the balance of the contract by the amount of ether transferred
    balance -= etherShares;

    // mark the caller as having claimed their share
    claimed[msg.sender] = true;

    // burn the shares on the burner contract
    //ERC20Burnable(burner).burn(tokenShares);
    // emit the Claimed event
    emit Claimed(msg.sender, tokenShares, etherShares);
  }

  // fallback function to accept ether payments
  receive() external payable {
    // increase the balance of the contract by the amount of ether received
    balance += msg.value;
  }
}

contracts/game.sol.content:
/* Create a game where there are 4 competing teams. Each team has their own token. To mint a token, the cost increses for the next minter.
 * Each team has a different color, and the last team to buy a key before the timer runs out wins. We don't need to keep track of every key purchased, only the most recent timestamp. The timer starts at 5 minutes after initialization. If your team wins, you split 90% of the pot and 10% remains for the next round.
 * The game ends if the timer runs out. teammembers must stake more than the other team's stake in order to purchase a key. If a key is purchased, the stake is transferred to the pot and the timer is extended to block.timestamp + 5 minutes. Upon a round concluding, the timer is set to block.timestamp + 5 minutes.
 when purchasing a key, the caller of that function is awarded an nft.
 People can mint at any time and if they mint tokens the price for the subsequent mints increases.
  */
 // SPDX-License-Identifier: MIT
pragma solidity ^0.8.1;
import '@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol';

import "./fanout.sol";
import "./teams.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";

  contract Game { 
      uint256 public price; //price of the key. starts at 1 eth. increases by 1% each time a key is purchased. 
      uint256 public pot; //pot of the game. 90% goes to the winner and 10% remains for the next round. 
      uint256 public timer; //timer of the game. starts at 5 minutes after initialization. if a key is purchased, timer is extended to block.timestamp + 5 minutes. if timer runs out, game ends and winner is determined. 
      address payable public owner; //owner of the contract. can withdraw funds from the pot at any time. 
      uint256  redStake = 0; //stake of red team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  blueStake = 0; //stake of blue team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  greenStake = 0; //stake of green team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  yellowStake = 0; //stake of yellow team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  redStakeDef = 0; //stake of red team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  blueStakeDef = 0; //stake of blue team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  greenStakeDef = 0; //stake of green team members in wei. must be greater than other teams' stakes in order to purchase a key. 
      uint256  yellowStakeDef = 0; //stake of yellow team members in wei. must be greater than other teams' stakes in order to purchase a key. 
    SomeTeam public  redTeam  ;//= new SomeTeam(address(this), "Red Team", "RED");
    SomeTeam public  blueTeam ;//= new SomeTeam(address(this), "Blue Team", "BLUE");
    SomeTeam  public yellowTeam;//= new SomeTeam(address(this), "Yellow Team", "YELL") ;
    SomeTeam public greenTeam;// new SomeTeam(address(this), "Green Team", "GREE") ;
    uint256 basePrice;
    function setTeams(address r, address b, address g, address y) public  {
                  require(msg.sender == owner);

        redTeam = SomeTeam(r);
        blueTeam = SomeTeam(b);
        greenTeam = SomeTeam(g);
        yellowTeam = SomeTeam(y);
    }
      constructor(uint256 _price) {
          price = _price;
          basePrice = _price;
          owner = payable(msg.sender);
          timer = block.timestamp + 5 minutes;
      }
      receive () external payable{
          require(msg.value > 0);
          pot += msg.value;
      }
      // each team has a mapping for all its members, and members can join and leave the team at any time. 
      mapping(address => bool) public redTeamMembers;
      mapping(address => bool) public blueTeamMembers;
      mapping(address => bool) public greenTeamMembers;
      mapping(address => bool) public yellowTeamMembers;
      uint256 rt = 0;
      uint256 bt = 0;

      uint256 gt = 0;

      uint256 yt = 0;


// each team has a function to join and leave the team. 
      function joinRedTeam() public {
          require(!redTeamMembers[msg.sender]);
          redTeamMembers[msg.sender] = true;
          rt++;
      }
      function leaveRedTeam() public {
          require(redTeamMembers[msg.sender]);
          redTeamMembers[msg.sender] = false;
          rt--;
      }
      function joinBlueTeam() public {
          require(!blueTeamMembers[msg.sender]);
          blueTeamMembers[msg.sender] = true;
          bt++;
      }
      function leaveBlueTeam() public {
          require(blueTeamMembers[msg.sender]);
          blueTeamMembers[msg.sender] = false;
          bt--;
      }
      function joinGreenTeam() public {
          require(!greenTeamMembers[msg.sender]);
          greenTeamMembers[msg.sender] = true;
          gt++;
      }
      function leaveGreenTeam() public {
